// frontend/src/ReservationForm.js
import React, { useState } from 'react';
import axios from 'axios';

function ReservationForm() {
  const [reservation, setReservation] = useState({
    customerName: '',
    email: '',
    phone: '',
    rooms: [],
    checkIn: '',
    checkOut: ''
  });

  // List of available hotel rooms
  const hotelRooms = [
    '105', '107', '109',
    '110', '111', '112', '113', '114', '115', '116', '117', '118', '119', '120',
    '205', '206', '207', '208', '209', '210', '211', '212', '213', '214', '215', '216', '217', '218', '219', '220'
  ];

  // Update reservation state for text inputs
  const handleChange = (e) => {
    setReservation({ ...reservation, [e.target.name]: e.target.value });
  };

  // Update reservation state for multi-select rooms
  const handleRoomsChange = (e) => {
    const options = e.target.options;
    const selectedRooms = [];
    for (let i = 0; i < options.length; i++) {
      if (options[i].selected) {
        selectedRooms.push(options[i].value);
      }
    }
    setReservation({ ...reservation, rooms: selectedRooms });
  };

  // Submit the form to add a reservation
  const handleSubmit = (e) => {
    e.preventDefault();
    axios.post('http://localhost:5001/api/reservations', reservation)
      .then(response => {
        alert('Reservation added successfully!');
        // Reset the form
        setReservation({
          customerName: '',
          email: '',
          phone: '',
          rooms: [],
          checkIn: '',
          checkOut: ''
        });
      })
      .catch(error => {
        console.error('Error adding reservation:', error);
      });
  };

  return (
    <div style={{ maxWidth: '500px', margin: 'auto', padding: '20px', border: '1px solid #ccc', borderRadius: '8px', boxShadow: '2px 2px 12px rgba(0,0,0,0.1)' }}>
      <h2>Reservation Management</h2>
      <form onSubmit={handleSubmit}>
        <div style={{ marginBottom: '15px' }}>
          <label>Contact Name:</label><br />
          <input
            type="text"
            name="customerName"
            value={reservation.customerName}
            onChange={handleChange}
            required
            style={{ width: '100%', padding: '8px', boxSizing: 'border-box' }}
          />
        </div>
        <div style={{ marginBottom: '15px' }}>
          <label>Email:</label><br />
          <input
            type="email"
            name="email"
            value={reservation.email}
            onChange={handleChange}
            required
            style={{ width: '100%', padding: '8px', boxSizing: 'border-box' }}
          />
        </div>
        <div style={{ marginBottom: '15px' }}>
          <label>Phone Number:</label><br />
          <input
            type="tel"
            name="phone"
            value={reservation.phone}
            onChange={handleChange}
            required
            style={{ width: '100%', padding: '8px', boxSizing: 'border-box' }}
          />
        </div>
        <div style={{ marginBottom: '15px' }}>
          <label>Select Room(s):</label><br />
          <select
            name="rooms"
            multiple
            value={reservation.rooms}
            onChange={handleRoomsChange}
            style={{ width: '100%', padding: '8px', boxSizing: 'border-box' }}
            size={6}
          >
            {hotelRooms.map(room => (
              <option key={room} value={room}>{room}</option>
            ))}
          </select>
        </div>
        <div style={{ marginBottom: '15px' }}>
          <label>Check-In Date:</label><br />
          <input
            type="date"
            name="checkIn"
            value={reservation.checkIn}
            onChange={handleChange}
            required
            style={{ width: '100%', padding: '8px', boxSizing: 'border-box' }}
          />
        </div>
        <div style={{ marginBottom: '15px' }}>
          <label>Check-Out Date:</label><br />
          <input
            type="date"
            name="checkOut"
            value={reservation.checkOut}
            onChange={handleChange}
            required
            style={{ width: '100%', padding: '8px', boxSizing: 'border-box' }}
          />
        </div>
        <button type="submit" style={{ padding: '10px 20px', backgroundColor: '#007BFF', color: '#fff', border: 'none', borderRadius: '4px', cursor: 'pointer' }}>
          Add Reservation
        </button>
      </form>
    </div>
  );
}

export default ReservationForm;
